// const port = 'http://localhost:5000'
import axios from 'axios';


function add_to_favorites(item,db){
    console.log(item,db );

    axios({
        method: 'post',
        url: '/favorites',
        data: {
          item,
          db
        }
      })}
    

export default {
    add_to_favorites
  };
